function add(a, b) {

    let result = a + b;

    return result;
    
}

function sub(a, b) {

    let result = a - b;

    return result;
    
}

function div(a, b) {

    let result = a / b;

    return result;
    
}

function mul(a, b) {

    let result = a * b;

    return result;
    
}

export default App;
